import React, { Component } from 'react';

import { connect } from 'react-redux'

import { VideoContainer } from './styles'
import ReactPlayer from 'react-player';

class Videos extends Component{

    constructor(props){
        super(props)

        this.props.buscaVideo('Receita para intolerantes')
    }
    render(){
        return(
            <>
                <VideoContainer>
                    {
                        this.props.video && (
                            <h2> Selecione um v√≠deo</h2>
                        )
                    }

                    {
                        this.props.video && (
                            <ReactPlayer
                                url={'https://www.youtube.com/watch?v='+ this.props.video.id.videoid}
                                width='100%' 
                                height='100%'
                            />
                        )
                    }
                    
                </VideoContainer>
            </>
        )
    }
}


 const mapStateToProps = (state => {
    return {
        videos: state.startVideo.video
    }
 })

export default connect(mapStateToProps, null) (Videos)
